                        }

                        if(dataItem.EncargadoId[0] == _spPageContextInfo.userId && dataItem.Estado == "equipo"){
                            return true;
                        }
					}
                    
                }
                ]
            }
        ],
        editable: {
            mode: "popup",
            template: ComiteTemplate.getTemplate(),
